function getUsuario(n,t){$.ajax({type:"POST",url:t,data:{id:n},success:function(n){mostrarUsuario(n)}})}function mostrarUsuario(n){var t,i;for(items=n,j=0,t=0;t<3;t++)i=document.getElementById("Select"),i.remove(t);$.each(items,function(n,t){$("input[name=Id]").val(t.id);$("input[name=UserName]").val(t.userName);$("input[name=Email]").val(t.email);document.getElementById("Select").options[0]=new Option(t.role,t.roleId);$("#dEmail").text(t.email);$("#dUserName").text(t.userName);$("#dRole").text(t.role);$("#eUsuario").text(t.email);$("input[name= EIdUsuario]").val(t.id)})}function getRoles(n){$.ajax({type:"POST",url:n,data:{},success:function(n){if(j===0){for(var t=0;t<n.length;t++)document.getElementById("Select").options[t]=new Option(n[t].text,n[t].value),document.getElementById("SelectNuevo").options[t]=new Option(n[t].text,n[t].value);j=1}}})}function editarUsuario(n){id=$("input[name=Id]")[0].value;email=$("input[name = Email]")[0].value;role=document.getElementById("Select");selectRole=role.options[role.selectedIndex].text;$.each(items,function(n,t){accessFailedCount=t.accessFailedCount;concurrentStamp=t.concurrentStamp;lockoutEnabled=t.lockoutEnabled;lockoutEnd=t.lockoutEnd;normalizedUserName=t.normalizedUserName;normalizedEmail=t.normalizedEmail;passwordHash=t.passwordHash;phoneNumberConfirmed=t.phoneNumberConfirmed;securityStamp=t.securityStamp;twoFactorEneable=t.twoFactorEneable;phoneNumber=t.phoneNumber;userName=t.userName;emailConfirmed=t.emailConfirmed});$.ajax({type:"POST",url:n,data:{id,userName,email,phoneNumber,accessFailedCount,concurrentStamp,emailConfirmed,lockoutEnabled,lockoutEnd,normalizedEmail,normalizedUserName,passwordHash,phoneNumberConfirmed,securityStamp,twoFactorEneable,selectRole},success:function(n){n=="Save"?window.location.href="Usuarios":alert("no se puede editar los datos del usuario")}})}function ocultarDetalleUsuario(){$("#modalDetalle").modal("hide")}function eliminarUsuario(n){var t=$("input[name=EIdUsuario]")[0].value;$.ajax({type:"POST",url:n,data:{id:t},success:function(n){n==="Delete"?window.location.href="Usuarios":alert("no se puede eliminar el usuario")}})}function crearUsuario(n){email=$("input[name=EmailNuevo]")[0].value;passwordHash=$("input[name=PasswordHashNuevo]")[0].value;role=document.getElementById("SelectNuevo");selectRole=role.options[role.selectedIndex].text;email==""?($("#EmailNuevo").focus(),alert("Ingrese un email")):passwordHash==""?($("#PasswordHashNuevo").focus(),alert("ingrese un password")):$.ajax({type:"POST",url:n,data:{email,passwordHash,selectRole},success:function(n){n==="Save"?window.location.href="Home":$("#mensajeNuevo").html("No se puede guardar el usuario. <br/>Selecciones un rol. <br/>Ingrese un email correcto.<br/>El password debe tener más de 6 caracteres, un número, una mayúscula y un caracter especial.")}})}$("#modalEditar").on("shown.bs.modal",function(){$("#myInput").focus()});var items,j=0,id,userName,email,role,selectRole,nombre,apellido,dni,accessFailedCount,concurrentStamp,lockoutEnabled,lockoutEnd,normalizedUserName,normalizedEmail,passwordHash,phoneNumberConfirmed,securityStamp,twoFactorEneable,phoneNumber,emailConfirmed;